import "./App.css";
import Home from "./components/home/home";

function App() {
  // const [loaded, setLoaded] = useState(false);
  // const [open, setOpen] = useState("open");

  return (
    <div className="App">
      <header className="App-header">
        <button>דף הבית</button>
        <button>סקרים</button>
        <button>פרסומות</button>
        <button>אתר</button>
      </header>
      {loaded && <Home />}
    </div>
  );
}

export default App;
